import styles from "./HomePage.module.css";

function HomePage() {
  return (
    <>
      <h1>베스트 상품</h1>
      <div>
        <div className={styles.img}></div>
        <p>아이패드 미니 팝니다</p>
        <p>500,000원</p>
      </div>
      <h1>판매 중인 상품</h1>
    </>
  );
}

export default HomePage;
